import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'web-dev1';
}
<header>
	<label class="logo">GYM-PAGE</label>
	<nav>
		<ul class="nav_links">
			<li [routerLinkActive]="'active'" [routerLinkActiveOptions]="{exact: true}"><a routerLink="/home">HOME</a></li>
			<li [routerLinkActive]="'active'"><a routerLink="/records">RECORDS</a></li>
			<li [routerLinkActive]="'active'"><a routerLink="/routines">ROUTINES</a></li>
			<li [routerLinkActive]="'active'"><a routerLink="/workouts">WORKOUTS</a></li>
		</ul>
	</nav>
    <a href="#login"><button>LOGOUT</button></a>
</header>
<router-outlet></router-outlet>
